import { BrowserRouter, Route, Routes } from "react-router-dom";
import { HomePage } from "./HomePage/HomePage";
import { Login } from "./Login/Login";

const App = () => {
  return (
    <BrowserRouter>
    <Routes>
    <Route exact path="/HomePage/HomePage" element={<HomePage />}/>
    <Route exact path="/Login/Login" ele>
      <Login />
    </Route>
    </Routes>
    </BrowserRouter>
  );
};

export { App };
